const R=Math.PI/180;
function haversine(lat1,lon1,lat2,lon2){
  const dLat=(lat2-lat1)*R,dLon=(lon2-lon1)*R;
  const a=Math.sin(dLat/2)**2+Math.cos(lat1*R)*Math.cos(lat2*R)*Math.sin(dLon/2)**2;
  return 12742*Math.asin(Math.sqrt(a));
}

// Gravity-weighted: large cities beat nearby neighborhoods.
// 2km distance floor prevents tiny places from winning just by proximity.
export function nearestCity(lat,lon){
  let best=null,bestScore=Infinity;
  for(let i=0;i<C.length;i++){
    const d=haversine(lat,lon,C[i][0]/100,C[i][1]/100);
    const pop=C[i][5]||15;
    const score=Math.max(d,2)/Math.pow(pop,0.35);
    if(score<bestScore){bestScore=score;best=i;}
  }
  if(best===null)return null;
  const c=C[best];
  return{city:c[2],country:N[c[3]],region:c[4]>=0?G[c[4]]:'',distance:Math.round(haversine(lat,lon,c[0]/100,c[1]/100))};
}
